import{_ as e,W as p,X as s,a1 as _}from"./framework-2afc6763.js";const c={},t=_('<p>阿里云盘默认情况是不允许分享压缩包的。</p><p>压缩软件里有一个创建自解压的压缩包的功能，用这个功能压缩出来的压缩包是一个exe的windous的程序文件，而这种文件在阿里云盘是可以分享的！</p><p>那么，就可以创建自解压的压缩包（下面是WinRAR和7z两种压缩软件的创建压缩包截图）</p><p><img src="https://i0.hdslb.com/bfs/article/30b9d7c1b61f7d5ab6f95fd70a64d707dbdc92fe.png@705w_638h_progressive.webp" alt="win rar压缩软件"></p><p><img src="https://i0.hdslb.com/bfs/article/77384eec4cdf8908a40d00cf027f060449da221d.png@942w_861h_progressive.webp" alt="7z压缩软件"></p><p>上传到阿里云盘进行测试</p><p><img src="https://i0.hdslb.com/bfs/article/a515422a0aeeb3c6e0e6f5ff3bad29c39bf42f21.gif@942w_491h_progressive.webp" alt=""></p><p>分享成功！</p><p>exe 格式的压缩包，在 windows 上直接双击运行就可以解压。</p><p>另外，创建自解压压缩包不要分卷！不要分卷！不要分卷！</p><p>分卷压缩出来的压缩包阿里云盘还是会识别出来的，第一个exe文件识别不出来，但后面的分卷文件是可以识别出来的。所以只能压缩成一个文件。</p>',11),a=[t];function r(i,d){return p(),s("div",null,a)}const o=e(c,[["render",r],["__file","阿里云盘分享压缩包方法.html.vue"]]);export{o as default};
